import json
from google.cloud import pubsub_v1


def publish_message(data:dict):
    publisher = pubsub_v1.PublisherClient()
    project_id = 'rj-escritorio-dev'
    topic = 'vision-ai-deteccao-alagamento'
    topic_name = f'projects/{project_id}/topics/{topic}'
    byte_data = json.dumps(data).encode("utf-8")
    future = publisher.publish(topic_name, byte_data)
    return future.result()

data = {
    "google_api_model": "gemini-pro-vision",
    "max_output_tokens": 256,
    "temperature": 0.4,
    "top_k": 32,
    "top_p": 1,
    "prompt": "You are an expert flooding detector. You are given an image. You must detect if there is flooding in the image. The output MUST be a JSON object with a boolean value for the key 'label'. If you don't know what to answer, you can set the key 'label' as false. Example: {'label': true}",
    "image_base64": ""
}

publish_message(data=data)


